import "./expenseApp.css";
function ExpenseApp() {
  return (
    <div>
      <div className="expense-item"></div>
      <div>31 October 2021</div>
      <div className="expense-item__description"></div>
      <div>Hotel Fun</div>
      <div className="expense-item__amount"></div>
      <div>400</div>
    </div>
  );
}

export default ExpenseApp;
